		function get_origin_x() {
		
			for (var u = 0; u < menu_list.length; u++) {
				menu_list[u].origin_x = menu_list[u].x;
				menu_list[u].origin_scal_x = menu_list[u].scaleX;
		
				if (menu_list[u].bkg) {
					menu_list[u].bkg.origin_scal_x = menu_list[u].bkg.scaleX;
				}
			}
		
		
		
		}
		
		
		
