		function anti_handle(rec) {
		
		
			console.log('anti_handle rec', rec);
			// reset dimensions before calculate x and y ;
			toreset();
		
			isZoneZoom = true;
		
			if (typeof rec.getTransformedBounds === 'function') {
				var w = rec.getTransformedBounds().width;
				var h = rec.getTransformedBounds().height;
		
			} else {
				var w = rec.width;
				var h = rec.height;
			}
		
			var pt = cont.getChildByName('chafaf').localToGlobal(rec.x + w / 2,
				rec.y + h / 2);
		
			var contRegxy = cont.globalToLocal(pt.x, pt.y);
		
		
		
		
			cont.regX = contRegxy.x;
			cont.regY = contRegxy.y;
		
			cont.stopDrag();
		
			tool_enable(false, 'zoom');
			//parentScale(e.currentTarget);
		
			var remove_pt = parentScale(rec, w, h);
		
			remove_zm.x = remove_pt[0];
			remove_zm.y = remove_pt[1];
			remove_zm.addEventListener("click", remove_zoom);
		
			that.addChild(remove_zm);
			//e.currentTarget.new_rtrn.gotoAndStop(1);
		}
		
		
